import './index.scss';
import Sidebar from '../Sidebar';
import { Outlet } from 'react-router-dom';

const Layout = () => {
    return (
        <div className='App'>
            <Sidebar />
            <div className='page'>
                <h1>Hi.</h1>
                <h2>My name is Erin,</h2>
                <h2>I'm your next <ch>Full Stack Developer</ch></h2>
            </div>
        </div>
    )
}

export default Layout;
